import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1></h1>
        <nav class="navbar navbar-expand-sm">
          <title>Horizon Ensemble</title>
          <ul class="navbar-nav">
            <li class="nav-item">
              <a class="nav-link">About</a>
            </li>
            <li class="nav-item">
              <a class="nav-link">Events</a>
            </li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
